
-- 
-- Structure for table 'shop_country_location_delivery_cities' 
-- 

DROP TABLE IF EXISTS `shop_country_location_delivery_cities`;
CREATE TABLE `shop_country_location_delivery_cities` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_country_location_id` int(11) NOT NULL DEFAULT '0',
  `name` varchar(255) NOT NULL,
  `shop_country_id` int(11) NOT NULL DEFAULT '0',
  `shop_country_name` varchar(255) NOT NULL,
  `shop_country_location_name` varchar(255) NOT NULL,
  `postal_code` varchar(150) NOT NULL,
  `sdek_id` varchar(150) NOT NULL,
  `boxberry_id` varchar(150) NOT NULL,
  `dpd_id` varchar(150) NOT NULL,
  `ozon_id` varchar(150) NOT NULL,
  `region_kladr_id` varchar(150) NOT NULL,
  `region_fias_id` varchar(150) NOT NULL,
  `name_en` varchar(150) DEFAULT '',
  `name_ru` varchar(150) DEFAULT '',
  `name_de` varchar(150) DEFAULT '',
  `name_fr` varchar(150) DEFAULT '',
  `name_it` varchar(150) DEFAULT '',
  `name_es` varchar(150) DEFAULT '',
  `name_pt` varchar(150) DEFAULT '',
  `name_ua` varchar(150) DEFAULT '',
  `name_be` varchar(150) DEFAULT '',
  `name_pl` varchar(150) DEFAULT '',
  `name_lt` varchar(150) DEFAULT '',
  `name_lv` varchar(150) DEFAULT '',
  `name_cz` varchar(150) DEFAULT '',
  `name_ja` varchar(150) DEFAULT '',
  `user_id` int(11) NOT NULL DEFAULT '0',
  `sorting` smallint(6) NOT NULL DEFAULT '0',
  `active` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `deleted` tinyint(1) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `deleted` (`deleted`,`shop_country_location_id`,`active`) USING BTREE,
  KEY `name` (`name`(10),`deleted`)
) ENGINE=MyISAM AUTO_INCREMENT=10962 DEFAULT CHARSET=utf8;

